bioghist.p:
In 1912 kwam het Departement van Binnenlands Bestuur tot de oprichting van het Encyclopedisch Bureau, dat tot taak kreeg gewestelijke monografieën samen te stellen en "mededelingen" te publiceren op basis van ambtelijke rapporten, reisverslagen en memories van overgave, die een bijdrage moesten vormen tot de vermeerdering van de historische, geografische, etnografische en economische kennis van de Buitenbezittingen   
Circulaire 22 oktober 1912 no. 2326, Bijblad 7737 . De hoofden van gewestelijk bestuur op de eilanden Java en Madoera dienden voortaan kopie-exemplaren van de memories van de onder hen werkende bestuursambtenaren te verstrekken aan het departement. Deze memories van "lagere" bestuursambtenaren moesten worden opgemaakt volgens het "militaire schema", dat door  het legerbestuur was opgesteld ten behoeve van de door officieren, civiel gezagshebbers en postcommandanten in te dienen militaire memories   
Circulaire 22 oktober 1912 no. 2325, Bijblad 7737A. . De hoofdindeling van het schema kende de volgende rubrieken:  


Aardrijkskundige beschrijving;


Bevolking;


Voortbrengselen;


Transportmiddelen;


Bestuur;


Politieke toestand;


Verhouding tot het Nederlands-Indische gouvernement

(zie bijlage A en B).

arrangement.p:
In de inventaris zijn de memores alsvolgt georganiseerd:  


per eiland, eilandengroep of gouvernement (bv. JAVA);


per gebiedsdeel van 1. (bv. MIDDEN-JAVA);


per residentie, afdeling of onderafdeling van 2. (bv. BUITENZORG).

odd.p:
Voorts verdient het aanbeveling, afzonderlijke kaarten over te leggen, waarop aan te geven: 


de geologische gesteldheid;


de klimatologische gegevens;


de begroeiïng;


de administratieve indeling;


de bevolking;


de veestapel, a.a.z.
